$(document).ready(function () {
    $(document).on('click', '.pdf', function () {
        window.doc = new jsPDF()
        var imgData = 'data:image/png;base64,';

        doc.addImage(imgData, 'png', 10, 10, 190, 55);


        window.y = 70;
        window.months = ["Janvier", 'Fevrier', "Mars", "Avril", "Mai", "Jui", "Juillet", "Aout", "Septembre", "Octobre", "Novembre", "Decembre"]
        var today = new Date();
        var dd = String(today.getDate()).padStart(2, '0');
        var mm = String(today.getMonth() + 1).padStart(2, '0');
        var yyyy = today.getFullYear();
        var id = event.target.id;
        fetch("config/configuration.txt").then(function (response) {
            return response.text()
        }).then(function (ip) {
            var urlUsers = "http://" + ip + ":8080";
            var urlPhone = "http://" + ip + ":8083";
            userId = sessionStorage.getItem("id")
            fetch(urlUsers + "/users/" + userId).then(function (response) {
                return response.json()
            }).then(function (user) {

                fetch(urlPhone + "/tva/" + id).then(function (response) {
                    return response.json()
                }).then(function (data) {

                    op = `<tr>
                        <td >First Name</td>
                        <td >`+ data.nom + `</td>
                    </tr>`

                    op = `<tr>
                        <td >Last Name</td>
                        <td >`+ data.prenom + `</td>
                    </tr>`

                    op = `<tr>
                        <td >Matricule</td>
                        <td >`+ data.matricule + `</td>
                    </tr>`

                    op += `<tr>
                        <td >Vehicule type </td>
                        <td >`+ data.vehicule.name + `</td>
                    </tr>`

                    op += `<tr>
                        <td >Amount</td>
                        <td >`+ data.amount + `</td>
                    </tr>`

                    op += `< <tr>
                        <td rowspan="3">Total</td>
                        <td>Cash: `+ data.cash + ` DH</td>
                    </tr>`

                    op += `< <tr>
                    <td></td>
                        <td>Minus: -`+ data.amount + ` DH</td>
                    </tr>`

                    op += `< <tr>
                    <td></td>

                        <td>Change: `+ data.minus + ` DH</td>
                    </tr>`



                    $("#body").html(op);

                    today = mm + '/' + dd + '/' + yyyy;
                    y+=40
                    doc.setFontSize(12)
                    doc.setFont('arial', 'bold')                   
                    doc.text(20, 110, 'Served by:  ' + user.firstName + " " + user.lastName);
                    doc.text(20, 115, 'Operation: ' + "TVA");
                    doc.text(20, 105, 'Date: ' + today);
                    doc.setFontSize(7)
                    doc.setTextColor("#DC143C", 20, 60, 0)
                    doc.setTextColor("#000000")
                    doc.setFontSize(20)
                    doc.setFontType('bold')
                    doc.setFont('arial', 'bold')
                    doc.text(70, 85, 'Vehicle Tax receipt');
                    doc.setFontSize(12)
                    y += 15
                    doc.text(20, y, 'The vehicle tax have been paid successfully, here is your receipt.Thank you. ');
                    var elem = document.getElementById("receipt");
                    var res = doc.autoTableHtmlToJson(elem);
                    y += 10
                    doc.autoTable(res.columns, res.data, { startY: y });
                    doc.output('dataurlnewwindow');     //opens the data uri in 
                    y += 5;
                })
            })
        })
    })
})

